int Distance(int x, int y)
{
    int xr = x / 0x10000;
    int yr = y / 0x10000;
    x -= xr * 0x10000;
    y -= yr * 0x10000;
    int xg = x / 0x100;
    int yg = y / 0x100;
    int xb = x - xg * 0x100;
    int yb = y - yg * 0x100;
    return pow((xr - yr), 2) + pow((xg - yg), 2) + pow((xb - yb), 2);
}

int Match(int a)
{
    int min = INT_MAX;
    int pos = 0;
    for (int i = 0; i < 256; i++)
    {
        int dist = Distance(system_colors[i], a);
        if (dist < min)
        {
            min = dist;
            pos = i;
        }
    }
    return pos;
}

